import { HeaderContainaer } from "../containers/header"

export default function Signin() {
  return (
    <>
      <Header>
        <Header.Inner>
          <Header.Logo
            src={"/images/icons/logo.svg"}
            alt="Nerflix"
            to={ROUTES.HOME}
          />
          <Header.ButtonLink to={ROUTES.SIGN_IN}></Header.ButtonLink>
        </Header.Inner>
        <Header.Wrapper>{children}</Header.Wrapper>
      </Header>
    </>
  )
}
